import React from 'react';

import './App.css';

class Home extends React.Component {

  render() {

    console.log('State: ', this.state);

    return(

    <div className="home-backgroud darken">    
      <h1 className="welcomeh1">Welcome to the MERN Warehouse</h1>
      <p className="homeP">Please navigate to one of the following warehouse components and rememeber - <br></br>
        always wear your hard hat :)</p>
      <div className="buttonArea">
        <button className="homeButton">Bins</button>
        <button>Products</button>
        <button>Inventory</button>
        <button>Orders</button>
        <button>Order Lines</button>
      </div>  
    </div>
    );
  }
}

export default Home;
